import React from 'react';
import CardList from './CardList';
import { robots } from './robots';
import SearchBar from './SearchBar';
import './RoboFriends.css';




class App extends React.Component{
    constructor (){
        this.state = {
            robots:robots,
            searchfield: ''
        }
    }


    render() 
    {
        return (
            <div className ="app">
                <h1>Robofriends</h1>
                <SearchBar />
                <CardList robots={robots}/>
            </div>
        );
    }
}


export default App;
